e_workflow_started:"Publication workflow started",message_workflow_starting:"Starting publication workflow",message_workflow_task_failure:"Workflow task failed to execute",message_workflow_task_success:"Workflow task executed successfully",mimes_label:"MIME types",modes_label:"Modes",moduleType_jahiapp_label:"JahiApp",moduleType_module_label:"Module",moduleType_profileModule_label:"My Space",moduleType_system_label:"System",moduleType_templatesSet_label:"Conjunto de modelos",mount_disclaimer:"Disclaimer",mount_disclaimer_label:"The mount function may not work properly depending on the Samba server. It is highly advised to use a local server to avoid performance issues. Please note that it will be considered as a shared repository (read and\/or write rights may be configured).",mountpoint_label:"Mount point",newDirName_label:"New directory name",newGroups_label:"Adicionar novos grupos",newPackageName_label:"New package name",newUsers_label:"Adicionar novos usu\u00E1rios",nodes_label:"Node types",org_jahia_admin_JahiaDisplayMessage_enterValidEmailAdmin_label:"Immettere un indirizzo e-mail valido (admin).",org_jahia_admin_JahiaDisplayMessage_enterValidEmailFrom_label:"Insira um e-mail v\u00E1lido (remetente).",org_jahia_admin_build_label:"build",org_jahia_admin_components_ManageComponents_deploy_help:"<div style=\"font-weight:bold\">Deploying Portlet Applications in Tomcat <\/div> <p>The deployment can be done via the Pluto Maven plugin or Ant task. Alternately, you can deploy the war using the \'Deploy new portlet\' link  that points to the app server\'s war deployer application. Clicking on that link opens up a new browser window, so you should disable any popup blockers for this page.<\/p><div style=\"font-weight:bold\">Uploading and deploying using Tomcat\'s Manager Application<\/div><p>The binary distribution of Jahia is built on Tomcat. Tomcat\'s deployer application is the manager application.Use that application to upload and deploy the war. A properly deployed portlet on Tomcat requires that the war has a context.xml file in META-INF containing a Context element and the crossContext attribute set to true like this:<br\/> &lt;Context path=\"HelloWorldPortlet\" docBase=\"HelloWorldPortlet\" crossContext=\"true\"&gt;<\/p><p>The logged in user also needs to have a manager role also,which is configured in conf\/tomcat-users.xml.<\/p><div style=\"font-weight:bold\">Deployment in Another Application Server<\/div><p> The \'Deploy new portlet\' link can be changed to an appropriate administrative page when Jahia is deployed inside another (non-Tomcat) app server. This is done by changing the \'jahiaWebAppsDeployerBaseURL\' property inside jahia.properties  to point to the URL of an appropriate administrative page. <\/p><\/div>",org_jahia_admin_daysLeftWarning_label:"Dias que faltam para a expira\u00E7\u00E3o",org_jahia_admin_emailSettings_label:"Configura\u00E7\u00E3o de E-mail",org_jahia_admin_entrie_label:"entrada",org_jahia_admin_entries_label:"entradas",org_jahia_admin_exit_label:"Sair da Administra\u00E7\u00E3o",org_jahia_admin_exitToStudio_label:"Go to Studio",org_jahia_admin_firstName_label:"Nome",org_jahia_admin_generalOptions_label:"Op\u00E7\u00F5es&nbsp;Gerais",org_jahia_admin_groupMessage_cannotRemoved_label:"Imposs\u00EDvel remover",org_jahia_admin_groupMessage_group_label:"Grupo",org_jahia_admin_groupMessage_selectGroup_label:"Selecione um grupo na caixa de sele\u00E7\u00E3o",org_jahia_admin_homePage_label:"P\u00E1gina inicial",org_jahia_admin_homeSite_label:"Site inicial",org_jahia_admin_info_LicenceInfo_current_label:"Current",org_jahia_admin_info_LicenceInfo_customTermsAndConditionsNotice_label:"Notice: There are custom terms and conditions",org_jahia_admin_info_LicenceInfo_expirationDate_label:"Expiration date",org_jahia_admin_info_LicenceInfo_jahiaEdition_ce:"",org_jahia_admin_info_LicenceInfo_jahiaEdition_ee:"Enterprise",org_jahia_admin_info_LicenceInfo_jahiaEdition_free_label:"",org_jahia_admin_info_LicenceInf